INSERT INTO `content` (`id`, `elementId`, `siteId`, `title`, `dateCreated`, `dateUpdated`, `uid`, `field_projectDescription`, `field_projectUrl`, `field_siteIntro`, `field_infoIntro`, `field_biography`, `field_contactIntro`, `field_hiddenProject`)
VALUES
	(1,1,1,NULL,'2018-10-14 04:54:48','2018-10-14 04:54:48','e07ad40d-40d4-401b-b0b9-910d53e2a2dd',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(2,2,1,'Information','2018-10-14 05:02:11','2018-10-21 10:24:06','8f2d8d03-eb97-4b81-8a82-0d900b29d9cd',NULL,NULL,NULL,'<h2>Dan<strong>’</strong>s works spans both cultural and commercial sectors, from large design institutions to tiny start-ups and he is available, on a project basis, to help lead or support design teams remotely, in-house or in-studio.</h2>','<p>Dan Flynn was born in Cork, Ireland and studied Visual Communication at IADT, Dublin (BA Hons, First Class). Upon graduating Dan spent time working at three renowned Irish studios Atelier, Detail and Zero-G, before moving to London to begin a four-year stint at internationally acclaimed studio Spin.</p><p>Under the mentorship of Tony Brook, Dan worked in an elite team on a diverse range of projects, earning a nomination for Designs of the Year, 2012 at the Design Museum, London.</p><p>In late 2014 Dan emigrated to Australia. Here joined Maud, Sydney in 2015 to begin work on a number of high profile jobs. As Creative Director from 2015–18, Dan lead some of the countries most complex identity projects for clients including UBank, BPay, Suncorp, Google and Australia Post. During this time Dan also helped establish a second office in Melbourne before starting a freelance practice in 2019.</p><p>Dan now provides design, development, strategy and consultancy services for cultural and commercial clients and has recently completed projects for the Alliance Graphique Internationale and Melbourne based start-up ShiftCo. </p>','To discuss a project, local or remote, get in contact below.',NULL),
	(3,3,1,'AGI','2018-10-14 05:52:43','2018-11-18 06:06:30','bb6f3771-f1ea-4abf-97c4-29d4baae3b21','<p>The Alliance Graphique Internationale [AGI] was established in 1951 as a means of uniting the world’s leading creative talents in design, advertising, and illustration. Bass, Calvert, Crouwel, Saville, Scher–the AGI is a who’s who of design. Membership is prestigious. Prospective members are invited to present work to the jury on the basis of quality and reputation. Members range from single practitioners to partners in global agencies. The first phase of strategic implementation sees the AGI site positioned as a source of design inspiration and education for professionals and students alike.</p>','http://a-g-i.org',NULL,NULL,NULL,NULL,0),
	(4,5,1,'Landscape','2018-10-14 05:56:07','2018-10-14 05:56:07','78a69606-9afc-4976-a3bd-4864f8cd833b',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(5,6,1,'Portrait','2018-10-14 05:56:57','2018-10-14 05:56:57','61dc1694-5df1-4191-a770-ac71ae806017',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(6,11,1,'Homepage','2018-10-14 06:23:10','2018-10-14 07:45:14','a9d07ba6-a500-4aff-a364-70a73bb070a0',NULL,NULL,'<h2>design.byform is the portfolio of Dan Flynn, a freelance designer, developer and creative director, working out of Melbourne, Australia.</h2><h2>Dan specializes in finding simple solutions to complex problems. His wide-ranging expertise encompasses strategy, design and development of visual identities, products and portfolios.</h2>',NULL,NULL,NULL,NULL),
	(7,12,1,'Adam Clarke Colour','2018-10-14 07:05:46','2018-11-17 07:00:45','a553ef6d-442b-4044-a83e-0eec86764c77','<p>Adam Clarke is a Colourist working out of Absolute Post in Soho, London. With over 10 years experience in the Post Production industry, Adam specialises in grades for Features, Commercials and Music videos. With a skill-set spanning well beyond colour grading, Adam has led projects for brands such as Sony, Ferrari, Vogue, Goldfraap and The Prodigy.  Full case study coming soon.</p>','http://adamclarkecolour.com',NULL,NULL,NULL,NULL,0),
	(8,15,1,'Osko','2018-10-20 04:32:35','2018-11-18 05:26:03','09f19a08-695e-43e7-9ac6-c01ed9ab7b64','<p>Several years in the making and involving contribution from every major financial institution, Osko brings instant payments to all of Australia. </p><p>Osko brings 24/7 nationwide payments to Australia, all in under 60 seconds. Other features include 280 character payment descriptions, PayID, the ability to request money and the option of adding attachments. Osko is set to become synonymous with these features as Australia begins to see Osko appear in apps, statements and transaction records.</p>','http://osko.com.au',NULL,NULL,NULL,NULL,0),
