	(27,46,1,'ShiftCo','2018-10-21 04:05:25','2018-11-17 07:00:30','546a6e82-8a4a-43e8-91d0-f129ad8e4320','<p>Founded in 2018, Melbourne based start up are on a mission to change healthcare recruitment forever.  By connecting healthcare workers directly with hospitals they can cut out expensive, inefficient agents, saving hospitals time, money and stress. With digital staff banks, automatic rostering, and predictive forecasting, ShiftCo helps hospitals deliver the best and safest care possible. </p>','http://shiftco.com.au',NULL,NULL,NULL,NULL,0),
	(28,48,1,'Suncorp','2018-10-21 04:06:34','2018-11-10 06:59:46','a708109f-2a54-4ece-89c5-48d6e14cf7e3','<p>Suncorp specialise in everything money—finance, insurance, and banking. Based in Brisbane, Queensland it has grown to be one of the biggest of Australia\'s banks and is also the single largest insurer in the country.</p><p> </p><p> </p><p> </p>','www.suncorp.com.au',NULL,NULL,NULL,NULL,0),
	(29,50,1,'Foxtel','2018-10-21 04:06:58','2018-11-18 06:05:56','4d56d63c-28e1-4086-9bc8-2fc0806b42b2','<p>As the countries largest producer and broadcaster Foxtel is synonymous with film and TV in Australia. With a new product, and much more affordable pricing model, Foxtel are striving to deliver the worlds best entertainment to everyone in Australia. </p><p>Full case study coming soon. </p><p> </p><p> </p>','http://foxtel.com.au',NULL,NULL,NULL,NULL,0),
	(30,52,1,'U Bank','2018-10-21 04:07:29','2018-11-10 07:30:48','9a25fe54-65dc-46df-99c5-21ead4cd3fc7','<p>Founded in 2007 as Australia\'s first online-only bank, UBANK operate under a “less is more” ethos</p><p>With no physical branches, a reduced portfolio of products and the lowest interest rates; UBANK operate at a lower cost than traditional banks. By removing unnecessary extras they pass savings directly to customers. This simplified, straight-forward ethos permeates ever facet of the business. No gimmicks, no tricks. Banking as it should be. </p>','http://ubank.com.au',NULL,NULL,NULL,NULL,0),
	(31,54,1,'Australia Post','2018-10-21 04:12:12','2018-11-10 07:41:57','b6c15476-eb1d-49d3-b70b-8603eb1df84d','<p>Over 18 months in the making and involving collaboration from scores of people inside and outside of the business, the Australia Post rebrand both respects the long standing history of its identity while also establishing a solid foundation to progress confidently into the next 30 years.  Full case study coming soon. </p><p> </p><p> </p>','http://auspost.com.au',NULL,NULL,NULL,NULL,0),
	(32,56,1,'Google Zoo','2018-10-21 04:15:26','2018-11-18 06:06:00','d5fc09a5-4c2d-4425-91c8-7b1b7f44f075','<p>Described as “a think tank for brands and agencies”, the Zoo are Google’s somewhat incognito wing of the tech giant.</p><p>Comprised of a global team of technologists, creatives, strategists and producers; Google Zoo explore how creative thinking and technology can combine to create new interaction between brands and consumers. Their analytical yet imaginative process informed a playful yet pragmatic identity design.</p>',NULL,NULL,NULL,NULL,NULL,0),
	(33,58,1,'Matter','2018-10-21 04:15:26','2018-11-17 08:39:16','1ebc36d3-f468-420a-b712-e3b076a22ebf','<p>Matter are out to fix  a broken energy market and bring solar to millions of tenants around the world.</p><p>Solar energy is clean energy. It’s also cheaper than grid electricity, but for millions of renters solar has been out of reach, until now. Matter gives tenants access to cheap, clean energy, and landlords access to a new revenue stream. </p>',NULL,NULL,NULL,NULL,NULL,0),
