	(41,69,1,'Bill Byron wines','2018-11-10 04:13:16','2018-11-18 06:06:08','429cd769-f856-496a-8296-abe996ed6440','<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>','http://billbyronwines.com',NULL,NULL,NULL,NULL,0),
	(42,71,1,'M&M','2018-11-10 04:17:18','2018-11-18 06:06:13','d7687b5d-fa5b-4f23-ab4c-22ead7ba7a72','<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \"M\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same print.</p>',NULL,NULL,NULL,NULL,NULL,0),
	(43,73,1,'AGI Open','2018-11-10 04:33:32','2018-11-18 06:02:49','dc695e75-6e58-4130-921a-f07fa3b9a220','<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>','http://agi-open.com',NULL,NULL,NULL,NULL,1),
	(44,75,1,'Wired Magazine','2018-11-10 05:01:27','2018-11-18 05:58:06','ee4d5625-aeac-48ce-b6e8-ccc48d41cd65','<p>Print and motion cover for Wired magazine. </p>','http://wired.com',NULL,NULL,NULL,NULL,1),
	(45,77,1,'Delfina Foundation','2018-11-10 05:02:51','2018-11-17 08:12:42','c6de162b-12f8-481f-b5f3-c431900d7b58','<p>Delfina Foundation is the largest not for profit art foundation in the UK. Founded in 2007 they are dedicated to facilitating artistic exchange and creative practice through residencies, partnerships and public programming.</p><p>Over the last twenty-five years, Delfina has become synonymous with artistic development. The Foundation was established as the successor to Delfina Studio Trust—renowned in the international art world for nurturing and supporting many highly acclaimed artists and more than a dozen Turner Prize nominees. Delfina Foundation is a non-political and non-grant-making foundation. </p>','http://delfinafoundation.com',NULL,NULL,NULL,NULL,1),
	(46,79,1,'Edmund de Waal','2018-11-10 05:03:41','2018-11-10 07:32:52','c68bc099-b378-4ef0-a135-52fde4d27ebb','<p> </p>',NULL,NULL,NULL,NULL,NULL,1),
	(47,81,1,'Okko','2018-11-10 05:04:48','2018-11-17 08:22:16','695c9b97-4dd0-43cd-af9d-a964b9257a2d','<p>Russian OTT service Okko, set out to disrupt a market renowned for piracy. By striking a balance between traditional lean-back TV watching and more active search and streaming, combined with an excellent catalogue of film and TV, Okko have managed to gain a massive subscription base in a very short time. Full case study coming soon. </p>','http://okko.tv',NULL,NULL,NULL,NULL,1),
	(48,83,1,'Matthew Hilton','2018-11-10 05:07:59','2018-11-18 06:03:21','9f110a63-12e4-409a-be60-a3591bda3b45','<p>One of Britain’s most esteemed industrial designers and a Royal Designer for Industry, Matthew\'s furniture is held in the permanent collections of the Victoria &amp; Albert Museum, and the Geffrye Museum, London.</p><p>Working in premium, robust materials including solid hardwood, cast iron, and brass, Hilton creates rigorously functional products that improve with the mark of age. Thinking like a sculptor, Matthew Hilton considers every view of a product equally, allowing for a sense of delight and surprise over the years as the user discovers new details and complexities. Matthew\'s site and identity were nominated for <a href=\"https://www.designboom.com/design/designs-of-the-year-2012-shortlist/\">Designs of the Year</a> in 2012.</p>','http://matthewhilton.com',NULL,NULL,NULL,NULL,1),
