	(9,2,1,1,1,4,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Information\",\"slug\":\"information\",\"postDate\":1539493320,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"22\":\"<p>Dan Flynn was born in Cork, Ireland and studied Visual Communication at IADT, Dublin (BA Hons, First Class). Upon graduating Dan spent time working at three renowned Irish studios Atelier, Detail and Zero-G, before moving to London to begin a four-year stint at internationally acclaimed studio Spin.</p><p>Under the mentorship of Tony Brook, Dan worked in an elite team on a diverse range of projects, earning a nomination for Designs of the Year, 2012 at the Design Museum, London.</p><p>In late 2014 Dan emigrated to Australia. Here joined Maud, Sydney in 2015 to begin work on a number of high profile jobs. As Creative Director from 2015–18, Dan lead some of the countries most complex identity projects for clients including UBank, BPay, Suncorp, Google and Australia Post. During this time Dan also helped establish a second office in Melbourne before starting a freelance practice in 2019.</p><p>Dan now provides design, development, strategy and consultancy services for cultural and commercial clients and has recently completed projects for the Alliance Graphique Internationale and Melbourne based start-up ShiftCo. </p>\",\"25\":{\"10\":{\"type\":\"3\",\"fields\":{\"email\":null,\"phone\":null,\"twitter\":null,\"insta\":null,\"address\":null}}},\"24\":\"<p>To discuss a project, local or remote, get in contact below. </p>\",\"21\":\"<p>Dan works with cultural and commercial clients, from large design institutions to tiny start-ups. Dan is also available on a project basis to help lead or support design teams remotely, in-house or in-studio.</p>\"}}','2018-10-14 06:53:32','2018-10-14 06:53:32','b45db857-fc7e-4511-ba0c-5fbdb8affd65'),
