	(53,15,2,1,1,8,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Osko\",\"slug\":\"osko\",\"postDate\":1540009920,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":\"<p>Several years in the making and involving contribution from every major financial institution, Osko brings instant payments to all of Australia. </p><p>Osko brings 24/7 nationwide payments to Australia, all in under 60 seconds. Other features include 280 character payment descriptions, PayID, the ability to request money and the option of adding attachments. Osko is set to become synonymous with these features as Australia beings to see the Osko marque appear in apps, statements and transaction records.</p>\",\"2\":{\"16\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2018\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":null,\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Sam Turner\",\"col2\":\"https://studiolathe.com\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"motion\",\"strategy\"]}}},\"18\":[\"45\"],\"15\":{\"41\":{\"type\":\"2\",\"fields\":{\"picture\":[\"37\"],\"digital\":false}},\"67\":{\"type\":\"2\",\"fields\":{\"picture\":[\"66\"],\"digital\":false}},\"68\":{\"type\":\"2\",\"fields\":{\"picture\":[\"65\"],\"digital\":false}},\"43\":{\"type\":\"2\",\"fields\":{\"picture\":[\"44\"],\"digital\":false}},\"17\":{\"type\":\"2\",\"fields\":{\"picture\":[\"34\"],\"digital\":false}},\"40\":{\"type\":\"2\",\"fields\":{\"picture\":[\"35\"],\"digital\":false}},\"42\":{\"type\":\"2\",\"fields\":{\"picture\":[\"45\"],\"digital\":false}}},\"13\":\"http://osko.com.au\"}}','2018-10-21 10:05:54','2018-10-21 10:05:54','e4b00490-c24d-43a4-9df9-64e67e25bcec'),
	(54,2,1,1,1,8,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Information\",\"slug\":\"information\",\"postDate\":1539493320,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"22\":\"<p>Dan Flynn was born in Cork, Ireland and studied Visual Communication at IADT, Dublin (BA Hons, First Class). Upon graduating Dan spent time working at three renowned Irish studios Atelier, Detail and Zero-G, before moving to London to begin a four-year stint at internationally acclaimed studio Spin.</p><p>Under the mentorship of Tony Brook, Dan worked in an elite team on a diverse range of projects, earning a nomination for Designs of the Year, 2012 at the Design Museum, London.</p><p>In late 2014 Dan emigrated to Australia. Here joined Maud, Sydney in 2015 to begin work on a number of high profile jobs. As Creative Director from 2015–18, Dan lead some of the countries most complex identity projects for clients including UBank, BPay, Suncorp, Google and Australia Post. During this time Dan also helped establish a second office in Melbourne before starting a freelance practice in 2019.</p><p>Dan now provides design, development, strategy and consultancy services for cultural and commercial clients and has recently completed projects for the Alliance Graphique Internationale and Melbourne based start-up ShiftCo. </p>\",\"25\":{\"10\":{\"type\":\"3\",\"fields\":{\"email\":\"dan@byform.co\",\"phone\":\"+61.439.849.717\",\"twitter\":\"@function_form\",\"insta\":\"@function_form\",\"address\":\"353 Napier Street,\\nFitzroy, Melbourne\\nVIC 3065, Australia\"}}},\"24\":\"To discuss a project, local or remote, get in contact below.\",\"21\":\"<h2>Dan\'s works spans both cultural and commercial clients, from large design institutions to tiny start-ups and he is available, on a project basis, to help lead or support design teams remotely, in-house or in-studio.</h2>\"}}','2018-10-21 10:13:13','2018-10-21 10:13:13','88b849b2-da7d-426e-8c18-07673ff69737'),
	(55,2,1,1,1,9,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Information\",\"slug\":\"information\",\"postDate\":1539493320,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"22\":\"<p>Dan Flynn was born in Cork, Ireland and studied Visual Communication at IADT, Dublin (BA Hons, First Class). Upon graduating Dan spent time working at three renowned Irish studios Atelier, Detail and Zero-G, before moving to London to begin a four-year stint at internationally acclaimed studio Spin.</p><p>Under the mentorship of Tony Brook, Dan worked in an elite team on a diverse range of projects, earning a nomination for Designs of the Year, 2012 at the Design Museum, London.</p><p>In late 2014 Dan emigrated to Australia. Here joined Maud, Sydney in 2015 to begin work on a number of high profile jobs. As Creative Director from 2015–18, Dan lead some of the countries most complex identity projects for clients including UBank, BPay, Suncorp, Google and Australia Post. During this time Dan also helped establish a second office in Melbourne before starting a freelance practice in 2019.</p><p>Dan now provides design, development, strategy and consultancy services for cultural and commercial clients and has recently completed projects for the Alliance Graphique Internationale and Melbourne based start-up ShiftCo. </p>\",\"25\":{\"10\":{\"type\":\"3\",\"fields\":{\"email\":\"dan@byform.co\",\"phone\":\"+61.439.849.717\",\"twitter\":\"@function_form\",\"insta\":\"@function_form\",\"address\":\"353 Napier Street,\\nFitzroy, Melbourne\\nVIC 3065, Australia\"}}},\"24\":\"To discuss a project, local or remote, get in contact below.\",\"21\":\"<h2>Dan<strong>’</strong>s works spans both cultural and commercial clients, from large design institutions to tiny start-ups and he is available, on a project basis, to help lead or support design teams remotely, in-house or in-studio.</h2>\"}}','2018-10-21 10:19:00','2018-10-21 10:19:00','b8072844-4182-43d2-b4dd-1e44d97fc2e7'),
	(56,2,1,1,1,10,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Information\",\"slug\":\"information\",\"postDate\":1539493320,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"22\":\"<p>Dan Flynn was born in Cork, Ireland and studied Visual Communication at IADT, Dublin (BA Hons, First Class). Upon graduating Dan spent time working at three renowned Irish studios Atelier, Detail and Zero-G, before moving to London to begin a four-year stint at internationally acclaimed studio Spin.</p><p>Under the mentorship of Tony Brook, Dan worked in an elite team on a diverse range of projects, earning a nomination for Designs of the Year, 2012 at the Design Museum, London.</p><p>In late 2014 Dan emigrated to Australia. Here joined Maud, Sydney in 2015 to begin work on a number of high profile jobs. As Creative Director from 2015–18, Dan lead some of the countries most complex identity projects for clients including UBank, BPay, Suncorp, Google and Australia Post. During this time Dan also helped establish a second office in Melbourne before starting a freelance practice in 2019.</p><p>Dan now provides design, development, strategy and consultancy services for cultural and commercial clients and has recently completed projects for the Alliance Graphique Internationale and Melbourne based start-up ShiftCo. </p>\",\"25\":{\"10\":{\"type\":\"3\",\"fields\":{\"email\":\"dan@byform.co\",\"phone\":\"+61.439.849.717\",\"twitter\":\"@function_form\",\"insta\":\"@function_form\",\"address\":\"353 Napier Street,\\nFitzroy, Melbourne\\nVIC 3065, Australia\"}}},\"24\":\"To discuss a project, local or remote, get in contact below.\",\"21\":\"<h2>Dan<strong>’</strong>s works spans both cultural and commercial sectors, from large design institutions to tiny start-ups and he is available, on a project basis, to help lead or support design teams remotely, in-house or in-studio.</h2>\"}}','2018-10-21 10:24:06','2018-10-21 10:24:06','eb02aac7-e00b-49aa-8352-2560a5ab483b'