	(57,69,2,1,1,1,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"\",\"col2\":\"\"}],\"developers\":[{\"col1\":\"\",\"col2\":\"\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[]}}},\"18\":[],\"15\":[],\"13\":\"www.billbyronwines.com\"}}','2018-11-10 04:13:16','2018-11-10 04:13:16','75b01514-67b1-4081-bc14-26af2bb91b6f'),
	(58,69,2,1,1,2,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandboxdigital.com.au/\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"6\"],\"15\":[],\"13\":\"www.billbyronwines.com\"}}','2018-11-10 04:14:34','2018-11-10 04:14:34','dac2a15b-0680-411d-871d-e4543c8f3e98'),
	(59,71,2,1,1,1,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"M&M\",\"slug\":\"m-m\",\"postDate\":1541823420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \\\"M\\\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same design.</p>\",\"2\":{\"72\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":[{\"col1\":\"\",\"col2\":\"\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\"]}}},\"18\":[],\"15\":[]}}','2018-11-10 04:17:18','2018-11-10 04:17:18','c21ada2a-e686-4e10-bdfe-c6a090e29a6f'),
	(60,58,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matter\",\"slug\":\"google-zoo-1\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Matter are out to fix  a broken energy market and bring solar to millions of tenants around the world.</p><p>Solar energy is clean energy. It’s also cheaper than grid electricity, but for millions of renters solar has been out of reach, until now. Matter gives tenants access to cheap, clean energy, and landlords access to a new revenue stream. </p>\",\"2\":{\"59\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2015\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co/\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au/\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandbox.digital/\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"64\"],\"15\":[]}}','2018-11-10 04:19:17','2018-11-10 04:19:17','3895191a-8ba8-48da-86cf-9c6435fdcfc0'),
	(61,56,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Google Zoo\",\"slug\":\"google-zoo\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Described as “a think tank for brands and agencies”, the Zoo are Google’s somewhat incognito wing of the tech giant.</p><p>Comprised of a global team of technologists, creatives, strategists and producers; Google Zoo explore how creative thinking and technology can combine to create new interaction between brands and consumers. Their analytical yet imaginative process informed a playful yet pragmatic identity design.</p>\",\"2\":{\"57\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":[{\"col1\":\"\",\"col2\":\"\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"motion\"]}}},\"18\":[\"60\"],\"15\":[]}}','2018-11-10 04:21:22','2018-11-10 04:21:22','3be9b89f-476d-4bce-a3dd-3ee2bac6e517'),
	(62,52,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"U Bank\",\"slug\":\"u-bank\",\"postDate\":1540094820,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Founded in 2007 as Australia\'s first online-only bank, UBANK operate under a “less is more” ethos</p><p>With no physical branches, a reduced portfolio of products and the lowest interest rates; UBANK operate at a lower cost than traditional banks. By removing unnecessary extras they pass savings directly to customers. This simplified, straight-forward ethos permeates ever facet of the business. No gimmicks, no tricks. Banking as it should be. </p>\",\"2\":{\"53\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"\",\"col2\":\"\"},{\"col1\":\"\",\"col2\":\"\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"61\"],\"15\":[],\"13\":\"www.ubank.com.au\"}}','2018-11-10 04:28:53','2018-11-10 04:28:53','29a20b1b-3564-47a5-bfbd-b3de1068fec6'),
	(63,15,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Osko\",\"slug\":\"osko\",\"postDate\":1540009920,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Several years in the making and involving contribution from every major financial institution, Osko brings instant payments to all of Australia. </p><p>Osko brings 24/7 nationwide payments to Australia, all in under 60 seconds. Other features include 280 character payment descriptions, PayID, the ability to request money and the option of adding attachments. Osko is set to become synonymous with these features as Australia begins to see Osko appear in apps, statements and transaction records.</p>\",\"2\":{\"16\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2018\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":null,\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Sam Turner\",\"col2\":\"https://studiolathe.com\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"discipline\":[\"identity\",\"motion\",\"strategy\"]}}},\"18\":[\"45\"],\"15\":{\"41\":{\"type\":\"2\",\"fields\":{\"picture\":[\"37\"],\"digital\":false}},\"67\":{\"type\":\"2\",\"fields\":{\"picture\":[\"66\"],\"digital\":false}},\"68\":{\"type\":\"2\",\"fields\":{\"picture\":[\"65\"],\"digital\":false}},\"43\":{\"type\":\"2\",\"fields\":{\"picture\":[\"44\"],\"digital\":false}},\"17\":{\"type\":\"2\",\"fields\":{\"picture\":[\"34\"],\"digital\":false}},\"40\":{\"type\":\"2\",\"fields\":{\"picture\":[\"35\"],\"digital\":false}},\"42\":{\"type\":\"2\",\"fields\":{\"picture\":[\"45\"],\"digital\":false}}},\"13\":\"http://osko.com.au\"}}','2018-11-10 04:30:21','2018-11-10 04:30:21','cd84d8bd-c2ce-46f7-b478-39a16f955ddb'),
	(64,73,2,1,1,1,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"\",\"col2\":\"\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"5\"],\"15\":[],\"13\":\"www.agi-open.com\"}}','2018-11-10 04:33:32','2018-11-10 04:33:32','d252fb83-f25c-4399-b4ec-e4ddd20f6abb'),
	(65,73,2,1,1,2,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"5\"],\"15\":[],\"13\":\"www.agi-open.com\"}}','2018-11-10 04:34:49','2018-11-10 04:34:49','9ca1a6df-0ffd-4781-adc4-ce7e0c60d173'),
	(66,71,2,1,1,2,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"M&M\",\"slug\":\"m-m\",\"postDate\":1541823420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \\\"M\\\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same design.</p>\",\"2\":{\"72\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":[{\"col1\":\"\",\"col2\":\"\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\"]}}},\"18\":[],\"15\":[]}}','2018-11-10 04:36:27','2018-11-10 04:36:27','8204ffc0-99a8-4a6c-b5f0-8b4a08be2ae6'),
	(67,69,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandboxdigital.com.au/\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"6\"],\"15\":[],\"13\":\"www.billbyronwines.com\"}}','2018-11-10 04:36:35','2018-11-10 04:36:35','fef1df73-5aa6-434a-857e-65d1240db427'),
	(68,58,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matter\",\"slug\":\"google-zoo-1\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Matter are out to fix  a broken energy market and bring solar to millions of tenants around the world.</p><p>Solar energy is clean energy. It’s also cheaper than grid electricity, but for millions of renters solar has been out of reach, until now. Matter gives tenants access to cheap, clean energy, and landlords access to a new revenue stream. </p>\",\"2\":{\"59\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2015\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co/\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au/\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandbox.digital/\"}],\"strategists\":[{\"col1\":\"\",\"col2\":\"\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"64\"],\"15\":[]}}','2018-11-10 04:36:40','2018-11-10 04:36:40','499b80a5-8e3b-40b6-a8b2-7c02a150930a'),
