	(93,3,2,1,1,13,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI\",\"slug\":\"agi\",\"postDate\":1539496200,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>The Alliance Graphique Internationale [AGI] was established in 1951 as a means of uniting the world’s leading creative talents in design, advertising, and illustration. Bass, Calvert, Crouwel, Saville, Scher–the AGI is a who’s who of design. Membership is prestigious. Prospective members are invited to present work to the jury on the basis of quality and reputation. Members range from single practitioners to partners in global agencies. The first phase of strategic implementation sees the AGI site positioned as a source of design inspiration and education for professionals and students alike.</p>\",\"2\":{\"4\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2017\",\"projectOwner\":\"form\",\"projectType\":[\"product\"],\"projectCollaborators\":[{\"col1\":\"Atelier David Smith\",\"col2\":\"http://atelier.ie\"},{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.com\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"David Smith \",\"col2\":\"http://atelier.ie\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"digital\"]}}},\"18\":[\"18\"],\"15\":{\"27\":{\"type\":\"2\",\"fields\":{\"picture\":[\"24\"],\"digital\":true}},\"28\":{\"type\":\"2\",\"fields\":{\"picture\":[\"25\"],\"digital\":true}},\"29\":{\"type\":\"2\",\"fields\":{\"picture\":[\"19\"],\"digital\":true}},\"30\":{\"type\":\"2\",\"fields\":{\"picture\":[\"21\"],\"digital\":true}},\"31\":{\"type\":\"2\",\"fields\":{\"picture\":[\"23\"],\"digital\":true}},\"32\":{\"type\":\"2\",\"fields\":{\"picture\":[\"26\"],\"digital\":true}}},\"13\":\"http://a-g-i.org\"}}','2018-11-10 05:12:24','2018-11-10 05:12:24','3f2d67ed-822a-48b5-b14d-c61c9ca28c3a'),
	(94,48,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Suncorp\",\"slug\":\"suncorp\",\"postDate\":1540094760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Suncorp specialise in everything money—finance, insurance, and banking. Based in Brisbane, Queensland it has grown to be one of the biggest of Australia\'s banks and is also the single largest insurer in the country.</p><p> </p><p> </p><p> </p>\",\"2\":{\"49\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2017\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Richard Smalley\",\"col2\":\"http://maud.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Paul O\'Connor\",\"col2\":\"http://maud.com.au\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"5\"],\"15\":[],\"13\":\"www.suncorp.com.au\"}}','2018-11-10 05:12:28','2018-11-10 05:12:28','c4e064ce-590f-4de5-94a8-ee08fe5dce7a'),
	(95,52,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"U Bank\",\"slug\":\"u-bank\",\"postDate\":1540094820,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Founded in 2007 as Australia\'s first online-only bank, UBANK operate under a “less is more” ethos</p><p>With no physical branches, a reduced portfolio of products and the lowest interest rates; UBANK operate at a lower cost than traditional banks. By removing unnecessary extras they pass savings directly to customers. This simplified, straight-forward ethos permeates ever facet of the business. No gimmicks, no tricks. Banking as it should be. </p>\",\"2\":{\"53\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Lisa Aitken\",\"col2\":\"http://maud.com.au\"},{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"61\"],\"15\":[],\"13\":\"www.ubank.com.au\"}}','2018-11-10 05:13:00','2018-11-10 05:13:00','b48da0d2-1362-4e6d-b08a-e9697a4e460b'),
	(96,56,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Google Zoo\",\"slug\":\"google-zoo\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Described as “a think tank for brands and agencies”, the Zoo are Google’s somewhat incognito wing of the tech giant.</p><p>Comprised of a global team of technologists, creatives, strategists and producers; Google Zoo explore how creative thinking and technology can combine to create new interaction between brands and consumers. Their analytical yet imaginative process informed a playful yet pragmatic identity design.</p>\",\"2\":{\"57\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"motion\"]}}},\"18\":[\"60\"],\"15\":[]}}','2018-11-10 05:13:07','2018-11-10 05:13:07','a7d0d8dd-d251-4964-b1d4-e7a0bd8a9887'),
	(97,58,2,1,1,6,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matter\",\"slug\":\"google-zoo-1\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Matter are out to fix  a broken energy market and bring solar to millions of tenants around the world.</p><p>Solar energy is clean energy. It’s also cheaper than grid electricity, but for millions of renters solar has been out of reach, until now. Matter gives tenants access to cheap, clean energy, and landlords access to a new revenue stream. </p>\",\"2\":{\"59\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2015\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co/\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au/\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandbox.digital/\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"64\"],\"15\":[]}}','2018-11-10 05:13:15','2018-11-10 05:13:15','7c1ad25c-2386-4179-ac4b-c650cefe99d6'),
	(98,69,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandboxdigital.com.au/\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"6\"],\"15\":[],\"13\":\"www.billbyronwines.com\"}}','2018-11-10 05:13:21','2018-11-10 05:13:21','b67c6b87-2514-4427-8e58-72743ae599ef'),
	(99,71,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"M&M\",\"slug\":\"m-m\",\"postDate\":1541823420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \\\"M\\\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same design.</p>\",\"2\":{\"72\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"5\"],\"15\":[]}}','2018-11-10 05:13:25','2018-11-10 05:13:25','c3007cd3-18fa-4ed5-b33d-ee7649a912d2'),
	(100,73,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"5\"],\"15\":[],\"13\":\"www.agi-open.com\"}}','2018-11-10 05:13:30','2018-11-10 05:13:30','c2940f1c-c5df-4168-ab32-fb5e70be135a'),
