	(105,83,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matthew Hilton\",\"slug\":\"matthew-hilton\",\"postDate\":1541826420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>One of Britain’s most esteemed industrial designers and a Royal Designer for Industry, Matthew\'s furniture is held in the permanent collections of the Victoria &amp; Albert Museum, and the Geffrye Museum, London.</p><p>Working in premium, robust materials including solid hardwood, cast iron, and brass, Hilton creates rigorously functional products that improve with the mark of age. Thinking like a sculptor, Matthew Hilton considers every view of a product equally, allowing for a sense of delight and surprise over the years as the user discovers new details and complexities. Matthew\'s site and identity were nominated for <a href=\\\"https://www.designboom.com/design/designs-of-the-year-2012-shortlist/\\\">Designs of the Year</a> in 2012.</p>\",\"2\":{\"84\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2011\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\",\"portfolio\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Patrick Eley\",\"col2\":\"https://www.linkedin.com/in/patrick-eley-b7303a32/\"}],\"developers\":[{\"col1\":\"Archive\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"5\"],\"15\":[],\"13\":\"http://matthewhilton.com\"}}','2018-11-10 05:13:52','2018-11-10 05:13:52','bfb6c251-042a-46b0-a63f-bf35c72e3f18'),
