	(121,69,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandboxdigital.com.au/\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"122\"],\"15\":{\"138\":{\"type\":\"2\",\"fields\":{\"picture\":[\"128\"],\"digital\":false}},\"139\":{\"type\":\"2\",\"fields\":{\"picture\":[\"129\"],\"digital\":false}},\"140\":{\"type\":\"2\",\"fields\":{\"picture\":[\"126\"],\"digital\":false}},\"141\":{\"type\":\"2\",\"fields\":{\"picture\":[\"131\"],\"digital\":true}},\"142\":{\"type\":\"2\",\"fields\":{\"picture\":[\"135\"],\"digital\":true}},\"143\":{\"type\":\"2\",\"fields\":{\"picture\":[\"123\"],\"digital\":false}},\"144\":{\"type\":\"2\",\"fields\":{\"picture\":[\"132\"],\"digital\":false}},\"145\":{\"type\":\"2\",\"fields\":{\"picture\":[\"134\"],\"digital\":false}},\"146\":{\"type\":\"2\",\"fields\":{\"picture\":[\"133\"],\"digital\":false}},\"147\":{\"type\":\"2\",\"fields\":{\"picture\":[\"137\"