	(124,71,2,1,1,6,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"M&M\",\"slug\":\"m-m\",\"postDate\":1541823420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \\\"M\\\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same design.</p>\",\"2\":{\"72\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"form\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"148\"],\"15\":{\"152\":{\"type\":\"2\",\"fields\":{\"picture\":[\"149\"],\"digital\":false}},\"153\":{\"type\":\"2\",\"fields\":{\"picture\":[\"151\"],\"digital\":false}},\"155\":{\"type\":\"2\",\"fields\":{\"picture\":[\"150\"],\"digital\":false}}}}}','2018-11-10 07:09:31','2018-11-10 07:09:31','3d0b3e9f-b5fb-4b20-915a-6163ea11b00d'),
	(125,73,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"156\"],\"15\":[],\"13\":\"www.agi-open.com\"}}','2018-11-10 07:12:02','2018-11-10 07:12:02','07ec2b20-5285-4368-895a-db5b78a4468a'),
