	(127,77,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Delfina Foundation\",\"slug\":\"delfina-foundation\",\"postDate\":1541826120,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>Delfina Foundation is the largest not for profit art foundation in the UK. Founded in 2007 they are dedicated to facilitating artistic exchange and creative practice through residencies, partnerships and public programming.</p><p>Over the last twenty-five years, Delfina has become synonymous with artistic development. The Foundation was established as the successor to Delfina Studio Trust—renowned in the international art world for nurturing and supporting many highly acclaimed artists and more than a dozen Turner Prize nominees. Delfina Foundation is a non-political and non-grant-making foundation. </p>\",\"2\":{\"78\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2011\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"digital\"]}}},\"18\":[\"158\"],\"15\":[],\"13\":\"http://delfinafoundation.com\"}}','2018-11-10 07:13:55','2018-11-10 07:13:55','7b844b0e-e651-4893-a935-48cb0c5d8ec6'),
