	(132,52,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"U Bank\",\"slug\":\"u-bank\",\"postDate\":1540094820,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Founded in 2007 as Australia\'s first online-only bank, UBANK operate under a “less is more” ethos</p><p>With no physical branches, a reduced portfolio of products and the lowest interest rates; UBANK operate at a lower cost than traditional banks. By removing unnecessary extras they pass savings directly to customers. This simplified, straight-forward ethos permeates ever facet of the business. No gimmicks, no tricks. Banking as it should be. </p>\",\"2\":{\"53\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Lisa Aitken\",\"col2\":\"http://maud.com.au\"},{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"discipline\":[\"identity\",\"digital\",\"strategy\"]}}},\"18\":[\"61\"],\"15\":{\"102\":{\"type\":\"2\",\"fields\":{\"picture\":[\"99\"],\"digital\":false}},\"103\":{\"type\":\"2\",\"fields\":{\"picture\":[\"86\"],\"digital\":false}},\"104\":{\"type\":\"2\",\"fields\":{\"picture\":[\"92\"],\"digital\":false}},\"105\":{\"type\":\"2\",\"fields\":{\"picture\":[\"89\"],\"digital\":false}},\"106\":{\"type\":\"2\",\"fields\":{\"picture\":[\"91\"],\"digital\":false}},\"107\":{\"type\":\"2\",\"fields\":{\"picture\":[\"85\"],\"digital\":false}},\"108\":{\"type\":\"2\",\"fields\":{\"picture\":[\"90\"],\"digital\":false}},\"109\":{\"type\":\"2\",\"fields\":{\"picture\":[\"94\"],\"digital\":false}},\"110\":{\"type\":\"2\",\"fields\":{\"picture\":[\"100\"],\"digital\":true}},\"111\":{\"type\":\"2\",\"fields\":{\"picture\":[\"1