	(149,3,2,1,1,14,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI\",\"slug\":\"agi\",\"postDate\":1539496200,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>The Alliance Graphique Internationale [AGI] was established in 1951 as a means of uniting the world’s leading creative talents in design, advertising, and illustration. Bass, Calvert, Crouwel, Saville, Scher–the AGI is a who’s who of design. Membership is prestigious. Prospective members are invited to present work to the jury on the basis of quality and reputation. Members range from single practitioners to partners in global agencies. The first phase of strategic implementation sees the AGI site positioned as a source of design inspiration and education for professionals and students alike.</p>\",\"2\":{\"4\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2017\",\"projectOwner\":\"form\",\"projectType\":[\"product\"],\"projectCollaborators\":[{\"col1\":\"Atelier David Smith\",\"col2\":\"http://atelier.ie\"},{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.com\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"David Smith \",\"col2\":\"http://atelier.ie\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"digital\"]}}},\"18\":[\"18\"],\"15\":{\"168\":{\"type\":\"2\",\"fields\":{\"picture\":[\"163\"],\"digital\":false}},\"27\":{\"type\":\"2\",\"fields\":{\"picture\":[\"24\"],\"digital\":true}},\"28\":{\"type\":\"2\",\"fields\":{\"picture\":[\"25\"],\"digital\":true}},\"29\":{\"type\":\"2\",\"fields\":{\"picture\":[\"19\"],\"digital\":true}},\"30\":{\"type\":\"2\",\"fields\":{\"picture\":[\"21\"],\"digital\":true}},\"31\":{\"type\":\"2\",\"fields\":{\"picture\":[\"23\"],\"digital\":true}},\"32\":{\"type\":\"2\",\"fields\":{\"picture\":[\"26\"],\"digital\":true}}},\"13\":\"http://a-g-i.org\"}}','2018-11-17 07:08:40','2018-11-17 07:08:40','23344175-bb38-45c7-952d-4cb0dc8b7484'),
	(150,56,2,1,1,6,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Google Zoo\",\"slug\":\"google-zoo\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Described as “a think tank for brands and agencies”, the Zoo are Google’s somewhat incognito wing of the tech giant.</p><p>Comprised of a global team of technologists, creatives, strategists and producers; Google Zoo explore how creative thinking and technology can combine to create new interaction between brands and consumers. Their analytical yet imaginative process informed a playful yet pragmatic identity design.</p>\",\"2\":{\"57\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"motion\"]}}},\"18\":[\"60\"],\"15\":{\"176\":{\"type\":\"2\",\"fields\":{\"picture\":[\"169\"],\"digital\":false}},\"177\":{\"type\":\"2\",\"fields\":{\"picture\":[\"173\"],\"digital\":false}},\"178\":{\"type\":\"2\",\"fields\":{\"picture\":[\"170\"],\"digital\":false}},\"179\":{\"type\":\"2\",\"fields\":{\"picture\":[\"171\"],\"digital\":false}},\"180\":{\"type\":\"2\",\"fields\":{\"picture\":[\"172\"],\"digital\":false}},\"181\":{\"type\":\"2\",\"fields\":{\"picture\":[\"175\"],\"digital\":false}},\"182\":{\"type\":\"2\",\"fields\":{\"picture\":[\"174\"],\"digital\":false}}}}}','2018-11-17 07:14:52','2018-11-17 07:14:52','7c444afe-f037-463f-a692-2061f362864c'),
