	(152,50,2,1,1,15,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Foxtel\",\"slug\":\"foxtel\",\"postDate\":1540094760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>As the countries largest producer and broadcaster Foxtel is synonymous with film and TV in Australia. With a new product, and much more affordable pricing model, Foxtel are striving to deliver the worlds best entertainment to everyone in Australia. </p><p>Full case study coming soon. </p><p> </p><p> </p>\",\"2\":{\"51\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2018\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://www.maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"},{\"col1\":\"Tomas Sabbatucci\",\"col2\":\"http://cargocollective.com/tomassabbatucci\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"},{\"col1\":\"Tom Fethers\",\"col2\":\"http://www.maud.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Lisa Aitken\",\"col2\":\"https://www.maud.com.au\"},{\"col1\":\"Paul O\'Connor\",\"col2\":\"https://www.maud.com.au\"}],\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"116\"],\"15\":{\"186\":{\"type\":\"2\",\"fields\":{\"picture\":[\"185\"],\"digital\":false}}},\"13\":\"http://foxtel.com.au\"}}','2018-11-17 07:23:51','2018-11-17 07:23:51','232d87fa-cf1a-4395-b220-e153fe888cfd'),
	(153,83,2,1,1,8,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matthew Hilton\",\"slug\":\"matthew-hilton\",\"postDate\":1541826420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>One of Britain’s most esteemed industrial designers and a Royal Designer for Industry, Matthew\'s furniture is held in the permanent collections of the Victoria &amp; Albert Museum, and the Geffrye Museum, London.</p><p>Working in premium, robust materials including solid hardwood, cast iron, and brass, Hilton creates rigorously functional products that improve with the mark of age. Thinking like a sculptor, Matthew Hilton considers every view of a product equally, allowing for a sense of delight and surprise over the years as the user discovers new details and complexities. Matthew\'s site and identity were nominated for <a href=\\\"https://www.designboom.com/design/designs-of-the-year-2012-shortlist/\\\">Designs of the Year</a> in 2012.</p>\",\"2\":{\"84\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2011\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\",\"portfolio\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Patrick Eley\",\"col2\":\"https://www.linkedin.com/in/patrick-eley-b7303a32/\"}],\"developers\":[{\"col1\":\"Archive\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"160\"],\"15\":{\"199\":{\"type\":\"2\",\"fields\":{\"picture\":[\"198\"],\"digital\":true}},\"200\":{\"type\":\"2\",\"fields\":{\"picture\":[\"197\"],\"digital\":true}},\"201\":{\"type\":\"2\",\"fields\":{\"picture\":[\"194\"],\"digital\":true}},\"202\":{\"type\":\"2\",\"fields\":{\"picture\":[\"195\"],\"digital\":true}},\"203\":{\"type\":\"2\",\"fields\":{\"picture\":[\"196\"],\"digital\":true}}},\"13\":\"http://matthewhilton.com\"}}','2018-11-17 08:09:25','2018-11-17 08:09:25','b2838873-f268-4f37-8031-63dbf177fbcb'),
	(154,77,2,1,1,6,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Delfina Foundation\",\"slug\":\"delfina-foundation\",\"postDate\":1541826120,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>Delfina Foundation is the largest not for profit art foundation in the UK. Founded in 2007 they are dedicated to facilitating artistic exchange and creative practice through residencies, partnerships and public programming.</p><p>Over the last twenty-five years, Delfina has become synonymous with artistic development. The Foundation was established as the successor to Delfina Studio Trust—renowned in the international art world for nurturing and supporting many highly acclaimed artists and more than a dozen Turner Prize nominees. Delfina Foundation is a non-political and non-grant-making foundation. </p>\",\"2\":{\"78\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2011\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"digital\"]}}},\"18\":[\"158\"],\"15\":{\"210\":{\"type\":\"2\",\"fields\":{\"picture\":[\"207\"],\"digital\":false}},\"211\":{\"type\":\"2\",\"fields\":{\"picture\":[\"208\"],\"digital\":false}},\"212\":{\"type\":\"2\",\"fields\":{\"picture\":[\"209\"],\"digital\":false}},\"213\":{\"type\":\"2\",\"fields\":{\"picture\":[\"204\"],\"digital\":false}},\"214\":{\"type\":\"2\",\"fields\":{\"picture\":[\"205\"],\"digital\":false}},\"215\":{\"type\":\"2\",\"fields\":{\"picture\":[\"206\"],\"digital\":false}}},\"13\":\"http://delfinafoundation.com\"}}','2018-11-17 08:12:42','2018-11-17 08:12:42','d65fe631-e3ab-440b-9e3c-6d951dd4c5c1'),
