	(161,73,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"226\"],\"15\":{\"234\":{\"type\":\"2\",\"fields\":{\"picture\":[\"222\"],\"digital\":true}},\"235\":{\"type\":\"2\",\"fields\":{\"picture\":[\"223\"],\"digital\":true}},\"236\":{\"type\":\"2\",\"fields\":{\"picture\":[\"224\"],\"digital\":true}},\"237\":{\"type\":\"2\",\"fields\":{\"pictu