	(176,50,2,1,1,21,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Foxtel\",\"slug\":\"foxtel\",\"postDate\":1540094760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>As the countries largest producer and broadcaster Foxtel is synonymous with film and TV in Australia. With a new product, and much more affordable pricing model, Foxtel are striving to deliver the worlds best entertainment to everyone in Australia. </p><p>Full case study coming soon. </p><p> </p><p> </p>\",\"2\":{\"51\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2018\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://www.maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"www.byform.co\"},{\"col1\":\"Tomas Sabbatucci\",\"col2\":\"http://cargocollective.com/tomassabbatucci\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"},{\"col1\":\"Tom Fethers\",\"col2\":\"http://www.maud.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Lisa Aitken\",\"col2\":\"https://www.maud.com.au\"},{\"col1\":\"Paul O\'Connor\",\"col2\":\"https://www.maud.com.au\"}],\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"116\"],\"15\":{\"186\":{\"type\":\"2\",\"fields\":{\"picture\":[\"185\"],\"digital\":false,\"video\":false}},\"263\":{\"type\":\"2\",\"fields\":{\"picture\":[\"187\"],\"digital\":false,\"video\":true}},\"267\":{\"type\":\"2\",\"fields\":{\"picture\":[\"190\"],\"digital\":false,\"video\":true}},\"264\":{\"type\":\"2\",\"fields\":{\"picture\":[\"189\"],\"digital\":false,\"video\":true}},\"265\":{\"type\":\"2\",\"fields\":{\"picture\":[\"188\"],\"digital\":false,\"video\":true}}},\"13\":\"http://foxtel.com.au\"}}','2018-11-18 06:01:44','2018-11-18 06:01:44','547139a3-b8cf-4841-b6aa-12bf44b81db8'),
	(177,73,2,1,1,7,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI Open\",\"slug\":\"agi-open\",\"postDate\":1541824380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>The AGI Open is one of the leading international design conferences. It is a two-day event featuring over 30 of the world’s leading graphic designers – all members of the Alliance Graphique Internationale (AGI).</p><p>The Alliance Graphique Internationale unites the world’s leading graphic designers in a professional gathering of common interest and intent. Membership is by invitation only: to be a member is to be judged ‘a person of influence and importance nationally and internationally’ by existing members. Founded in 1954, past members have included Cassandre, Josef Müller-Brockmann and Paul Rand. Current members include Wim Crouwel, Massimo Vignelli, Paula Scher and Marian Bantjes.</p><p>Each year AGI Open is held in a different world city and features talks, interviews, workshops and debates. In recent years it has been staged in Porto, Barcelona, Hong Kong, Sao Paula, Seoul and Paris.</p>\",\"2\":{\"74\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2013\",\"projectOwner\":\"spin\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Claudia Klat\",\"col2\":\"http://spin.co.uk\"},{\"col1\":\"Callin Mackintosh\",\"col2\":\"http://www.callinmackintosh.com/\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\"]}}},\"18\":[\"226\"],\"15\":{\"234\":{\"type\":\"2\",\"fields\":{\"picture\":[\"222\"],\"digital\":true,\"video\":false}},\"235\":{\"type\":\"2\",\"fields\":{\"picture\":[\"223\"],\"digital\":true,\"video\":false}},\"236\":{\"type\":\"2\",\"fields\":{\"picture\":[\"224\"],\"digital\":true,\"video\":false}},\"268\":{\"type\":\"2\",\"fields\":{\"picture\":[\"228\"],\"digital\":false,\"video\":false}},\"240\":{\"type\":\"2\",\"fields\":{\"picture\":[\"230\"],\"digital\":false,\"video\":false}},\"241\":{\"type\":\"2\",\"fields\":{\"picture\":[\"231\"],\"digital\":false,\"video\":false}},\"242\":{\"type\":\"2\",\"fields\":{\"picture\":[\"232\"],\"digital\":false,\"video\":false}},\"243\":{\"type\":\"2\",\"fields\":{\"picture\":[\"233\"],\"digital\":false,\"video\":false}}},\"13\":\"http://agi-open.com\"}}','2018-11-18 06:02:50','2018-11-18 06:02:50','9c020a2f-3dd2-42d5-9c40-d2f6eae31452'),
	(178,83,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Matthew Hilton\",\"slug\":\"matthew-hilton\",\"postDate\":1541826420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":true,\"1\":\"<p>One of Britain’s most esteemed industrial designers and a Royal Designer for Industry, Matthew\'s furniture is held in the permanent collections of the Victoria &amp; Albert Museum, and the Geffrye Museum, London.</p><p>Working in premium, robust materials including solid hardwood, cast iron, and brass, Hilton creates rigorously functional products that improve with the mark of age. Thinking like a sculptor, Matthew Hilton considers every view of a product equally, allowing for a sense of delight and surprise over the years as the user discovers new details and complexities. Matthew\'s site and identity were nominated for <a href=\\\"https://www.designboom.com/design/designs-of-the-year-2012-shortlist/\\\">Designs of the Year</a> in 2012.</p>\",\"2\":{\"84\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2011\",\"projectOwner\":\"spin\",\"projectType\":[\"portfolio\"],\"projectCollaborators\":[{\"col1\":\"Spin\",\"col2\":\"http://spin.co.uk\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Patrick Eley\",\"col2\":\"https://www.linkedin.com/in/patrick-eley-b7303a32/\"}],\"developers\":[{\"col1\":\"Archive\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"160\"],\"15\":{\"199\":{\"type\":\"2\",\"fields\":{\"picture\":[\"198\"],\"digital\":true,\"video\":false}},\"200\":{\"type\":\"2\",\"fields\":{\"picture\":[\"197\"],\"digital\":true,\"video\":false}},\"201\":{\"type\":\"2\",\"fields\":{\"picture\":[\"194\"],\"digital\":true,\"video\":false}},\"202\":{\"type\":\"2\",\"fields\":{\"picture\":[\"195\"],\"digital\":true,\"video\":false}},\"203\":{\"type\":\"2\",\"fields\":{\"picture\":[\"196\"],\"digital\":true,\"video\":false}}},\"13\":\"http://matthewhilton.com\"}}','2018-11-18 06:03:21','2018-11-18 06:03:21','e947d09d-fab7-4070-a13f-30f734ab5bc4'),
	(179,50,2,1,1,22,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Foxtel\",\"slug\":\"foxtel\",\"postDate\":1540094760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>As the countries largest producer and broadcaster Foxtel is synonymous with film and TV in Australia. With a new product, and much more affordable pricing model, Foxtel are striving to deliver the worlds best entertainment to everyone in Australia. </p><p>Full case study coming soon. </p><p> </p><p> </p>\",\"2\":{\"51\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2018\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://www.maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Tomas Sabbatucci\",\"col2\":\"http://cargocollective.com/tomassabbatucci\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"},{\"col1\":\"Tom Fethers\",\"col2\":\"http://www.maud.com.au\"}],\"developers\":null,\"strategists\":[{\"col1\":\"Lisa Aitken\",\"col2\":\"https://www.maud.com.au\"},{\"col1\":\"Paul O\'Connor\",\"col2\":\"https://www.maud.com.au\"}],\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"116\"],\"15\":{\"186\":{\"type\":\"2\",\"fields\":{\"picture\":[\"185\"],\"digital\":false,\"video\":false}},\"263\":{\"type\":\"2\",\"fields\":{\"picture\":[\"187\"],\"digital\":false,\"video\":true}},\"267\":{\"type\":\"2\",\"fields\":{\"picture\":[\"190\"],\"digital\":false,\"video\":true}},\"264\":{\"type\":\"2\",\"fields\":{\"picture\":[\"189\"],\"digital\":false,\"video\":true}},\"265\":{\"type\":\"2\",\"fields\":{\"picture\":[\"188\"],\"digital\":false,\"video\":true}}},\"13\":\"http://foxtel.com.au\"}}','2018-11-18 06:05:56','2018-11-18 06:05:56','4c89f7e2-3e28-44ee-82a4-29c5a8a5b060'),
	(180,56,2,1,1,8,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Google Zoo\",\"slug\":\"google-zoo\",\"postDate\":1540095300,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Described as “a think tank for brands and agencies”, the Zoo are Google’s somewhat incognito wing of the tech giant.</p><p>Comprised of a global team of technologists, creatives, strategists and producers; Google Zoo explore how creative thinking and technology can combine to create new interaction between brands and consumers. Their analytical yet imaginative process informed a playful yet pragmatic identity design.</p>\",\"2\":{\"57\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2016\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\",\"motion\"]}}},\"18\":[\"60\"],\"15\":{\"176\":{\"type\":\"2\",\"fields\":{\"picture\":[\"169\"],\"digital\":false,\"video\":false}},\"178\":{\"type\":\"2\",\"fields\":{\"picture\":[\"170\"],\"digital\":false,\"video\":false}},\"179\":{\"type\":\"2\",\"fields\":{\"picture\":[\"171\"],\"digital\":false,\"video\":false}},\"180\":{\"type\":\"2\",\"fields\":{\"picture\":[\"172\"],\"digital\":false,\"video\":false}},\"181\":{\"type\":\"2\",\"fields\":{\"picture\":[\"175\"],\"digital\":false,\"video\":false}},\"182\":{\"type\":\"2\",\"fields\":{\"picture\":[\"174\"],\"digital\":false,\"video\":false}},\"177\":{\"type\":\"2\",\"fields\":{\"picture\":[\"173\"],\"digital\":false,\"video\":false}},\"184\":{\"type\":\"2\",\"fields\":{\"picture\":[\"183\"],\"digital\":false,\"video\":false}}}}}','2018-11-18 06:06:01','2018-11-18 06:06:01','b9472ffa-fa89-48e5-97f1-41bdbaca7b13'),
	(181,69,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Bill Byron wines\",\"slug\":\"bill-byron-wines\",\"postDate\":1541823180,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>​Named after the late William Byron; Bill Byron wines was founded to honour his larger-than-life legacy. </p><p>Their first wine, an organic blend of Shiraz, Cabernet and Merlot, contains hand selected grapes from lots 101, 102 and 105 from their New South Wales [AUS] vineyard; established by Bill Byron himself. Bill’s legacy and the location of these historic vines lay the foundation for the identity, website and label design; big, bold and without pretension.</p>\",\"2\":{\"70\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\",\"product\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"Adam Vella\",\"col2\":\"http://adamvella.com.au\"}],\"developers\":[{\"col1\":\"Sandbox\",\"col2\":\"http://sandboxdigital.com.au/\"}],\"strategists\":null,\"discipline\":[\"identity\",\"digital\",\"motion\",\"strategy\"]}}},\"18\":[\"128\"],\"15\":{\"139\":{\"type\":\"2\",\"fields\":{\"picture\":[\"129\"],\"digital\":false,\"video\":false}},\"140\":{\"type\":\"2\",\"fields\":{\"picture\":[\"126\"],\"digital\":false,\"video\":false}},\"141\":{\"type\":\"2\",\"fields\":{\"picture\":[\"131\"],\"digital\":true,\"video\":false}},\"142\":{\"type\":\"2\",\"fields\":{\"picture\":[\"135\"],\"digital\":true,\"video\":false}},\"143\":{\"type\":\"2\",\"fields\":{\"picture\":[\"123\"],\"digital\":false,\"video\":false}},\"144\":{\"type\":\"2\",\"fields\":{\"picture\":[\"132\"],\"digital\":false,\"video\":false}},\"145\":{\"type\":\"2\",\"fields\":{\"picture\":[\"134\"],\"digital\":false,\"video\":false}},\"146\":{\"type\":\"2\",\"fields\":{\"picture\":[\"133\"],\"digital\":false,\"video\":false}},\"147\":{\"type\":\"2\",\"fields\":{\"picture\":[\"137\"],\"digital\":false,\"video\":false}}},\"13\":\"http://billbyronwines.com\"}}','2018-11-18 06:06:09','2018-11-18 06:06:09','64ebfee6-da17-45f8-a7a4-aeb4d1e5f292'),
	(182,71,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"M&M\",\"slug\":\"m-m\",\"postDate\":1541823420,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>Every December the Monkeys and Maud host a festive lunch, to celebrate the years successes.</p><p>This year, in place of a traditional invitation, we created a series of unique screen-printed posters. With 10+ \\\"M\\\" designs, 8 paper stocks, and 4 colour variations we created a wide variety of designs, ensuring no two people received the same print.</p>\",\"2\":{\"72\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2014\",\"projectOwner\":\"maud\",\"projectType\":[\"identity\"],\"projectCollaborators\":[{\"col1\":\"Maud\",\"col2\":\"http://maud.com.au\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"}],\"developers\":null,\"strategists\":null,\"discipline\":[\"identity\"]}}},\"18\":[\"148\"],\"15\":{\"152\":{\"type\":\"2\",\"fields\":{\"picture\":[\"149\"],\"digital\":false,\"video\":false}},\"153\":{\"type\":\"2\",\"fields\":{\"picture\":[\"151\"],\"digital\":false,\"video\":false}},\"155\":{\"type\":\"2\",\"fields\":{\"picture\":[\"150\"],\"digital\":false,\"video\":false}}}}}','2018-11-18 06:06:13','2018-11-18 06:06:13','df3d259f-d46b-4f51-b488-ea7f0945b21a'),
	(183,3,2,1,1,15,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"AGI\",\"slug\":\"agi\",\"postDate\":1539496200,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":false,\"1\":\"<p>The Alliance Graphique Internationale [AGI] was established in 1951 as a means of uniting the world’s leading creative talents in design, advertising, and illustration. Bass, Calvert, Crouwel, Saville, Scher–the AGI is a who’s who of design. Membership is prestigious. Prospective members are invited to present work to the jury on the basis of quality and reputation. Members range from single practitioners to partners in global agencies. The first phase of strategic implementation sees the AGI site positioned as a source of design inspiration and education for professionals and students alike.</p>\",\"2\":{\"4\":{\"type\":\"1\",\"fields\":{\"projectYear\":\"2017\",\"projectOwner\":\"form\",\"projectType\":[\"product\",\"portfolio\"],\"projectCollaborators\":[{\"col1\":\"Atelier David Smith\",\"col2\":\"http://atelier.ie\"},{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.com\"}],\"designers\":[{\"col1\":\"Dan Flynn\",\"col2\":\"http://byform.co\"},{\"col1\":\"David Smith \",\"col2\":\"http://atelier.ie\"}],\"developers\":[{\"col1\":\"Archive Studio\",\"col2\":\"http://archive.studio\"}],\"strategists\":null,\"discipline\":[\"digital\"]}}},\"18\":[\"18\"],\"15\":{\"168\":{\"type\":\"2\",\"fields\":{\"picture\":[\"163\"],\"digital\":false,\"video\":false}},\"27\":{\"type\":\"2\",\"fields\":{\"picture\":[\"24\"],\"digital\":true,\"video\":false}},\"28\":{\"type\":\"2\",\"fields\":{\"picture\":[\"25\"],\"digital\":true,\"video\":false}},\"29\":{\"type\":\"2\",\"fields\":{\"picture\":[\"19\"],\"digital\":true,\"video\":false}},\"30\":{\"type\":\"2\",\"fields\":{\"picture\":[\"21\"],\"digital\":true,\"video\":false}},\"31\":{\"type\":\"2\",\"fields\":{\"picture\":[\"23\"],\"digital\":true,\"video\":false}},\"32\":{\"type\":\"2\",\"fields\":{\"picture\":[\"26\"],\"di