	(2,'field',21,1,' dan s works spans both cultural and commercial sectors from large design institutions to tiny start ups and he is available on a project basis to help lead or support design teams remotely in house or in studio '),
	(2,'field',22,1,' dan flynn was born in cork ireland and studied visual communication at iadt dublin ba hons first class upon graduating dan spent time working at three renowned irish studios atelier detail and zero g before moving to london to begin a four year stint at internationally acclaimed studio spin under the mentorship of tony brook dan worked in an elite team on a diverse range of projects earning a nomination for designs of the year 2012 at the design museum london in late 2014 dan emigrated to australia here joined maud sydney in 2015 to begin work on a number of high profile jobs as creative director from 2015 18 dan lead some of the countries most complex identity projects for clients including ubank bpay suncorp google and australia post during this time dan also helped establish a second office in melbourne before starting a freelance practice in 2019 dan now provides design development strategy and consultancy services for cultural and commercial clients and has recently completed projects for the alliance graphique internationale and melbourne based start up shiftco '),
